import styled from 'styled-components';

export const MainWrapper = styled.div`
  width: 300px;
  margin: 0 auto;
  padding-top: 20px;
  text-align: center;
  background-color: #fff;
  border-radius: 10px;
  box-shadow: 1px -1px 16px 0px rgba(0, 0, 0, 0.76);
`;
